import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { FaFacebookF, FaLinkedinIn, FaInstagram, FaUser, FaShoppingCart, FaPhoneAlt } from 'react-icons/fa';

import './Header.css';

const Header = () => {
  return (
    <>
      {/* Top Blue Bar */}
      <Navbar style={{ backgroundColor: '#0056a3', color: 'white' }} className="py-2">
        <Container fluid className="d-flex justify-content-between align-items-center">
          {/* Social Icons */}
          <div className="d-flex gap-3">
            <a href="#" style={{ color: 'white' }}><FaFacebookF size={20} /></a>
            <a href="#" style={{ color: 'white' }}><FaLinkedinIn size={20} /></a>
            <a href="#" style={{ color: 'white' }}><FaInstagram size={20} /></a>
          </div>

          {/* Call Us */}
          <div className="d-flex align-items-center">
            <FaPhoneAlt className="me-2" />
            <span>Call Us: <strong>+91-7669955211</strong></span>
          </div>

          {/* My Account / My Cart */}
          <div className="d-flex gap-3">
            <button className="btn btn-primary d-flex align-items-center gap-2">
              <FaUser /> My Account
            </button>
            <button className="btn btn-primary d-flex align-items-center gap-2 position-relative">
              <FaShoppingCart /> My Cart
              <span style={{ position: 'absolute', top: '-5px', right: '-5px', background: 'orange', borderRadius: '50%', width: '10px', height: '10px' }}></span>
            </button>
          </div>
        </Container>
      </Navbar>

      {/* Bottom White Bar */}
      <Navbar bg="light" expand="lg" className="shadow-sm">
        <Container fluid>
          {/* Logo */}
          <Navbar.Brand href="/" className="d-flex align-items-center">
            <img src="/assets/logo.jpeg" alt="Logo" style={{ width: '100px' }} />
          </Navbar.Brand>

          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            {/* Menu */}
            <Nav className="ms-auto">
              <Nav.Link href="/">HOME</Nav.Link>
              <Nav.Link href="/about">ABOUT US</Nav.Link>
              <Nav.Link href="/services">SERVICES</Nav.Link>
              <Nav.Link href="/blog">BLOG</Nav.Link>
              <Nav.Link href="/privacy">PRIVACY POLICY</Nav.Link>
              <Nav.Link href="/contact">CONTACT</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
